<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <style>


    svg {
      font: 10px sans-serif;
    }

    .background path {
      fill: none;
      stroke: #ddd;
      shape-rendering: crispEdges;
    }

    .foreground path {
      fill: none;
      stroke: steelblue;
    }

    .brush .extent {
      fill-opacity: .3;
      stroke: #fff;
      shape-rendering: crispEdges;
    }

    .clusterbrush_panel {
      background-color: #f8efc0;
    }

    .clusterbrush_panel .clusterrect{
      fill:#fff7bc !important;

      opacity: 0.8;
    }



    .radialbrush_panel {
      background-color: #f8efc0;
    }
    .radialbrush_panel .radialrect{
      fill:#fff7bc !important;

      opacity: 0.8;
    }


    .axis line,
    .axis path {
      fill: none;
      stroke: #000;
      shape-rendering: crispEdges;
    }

    .axis text {
      text-shadow: 0 1px 0 #fff, 1px 0 0 #fff, 0 -1px 0 #fff, -1px 0 0 #fff;
      cursor: move;
    }

    .cluster_brush_c2{
      opacity: 0.6;
      fill:green;
      background-color: #f8efc0;
    }

    .cluster_brush_c1{
      opacity: 0.8;
      fill:green;
      background-color: #f8efc0;
    }

    .radial_brush_b{
      opacity: 0.2;
      background-color: #f8efc0;
      fill:green;
    }

    .radial_brush_h2 {
      opacity: 0.2;
      fill:green;
      background-color: #f8efc0;

    }
    .radial_brush_h1 {
      opacity: 0.2;
      fill:green;
      background-color: #f8efc0;

    }


    .ss_point_active{
      background-color: red;
      fill:red !important;
    }


    .OA_buttons {
      height: 30px;
      background-color: #f8efc0;
      -moz-border-radius: 20px;
      -webkit-border-radius: 20px;
      -khtml-border-radius: 20px;
      border-radius: 20px;
      margin-bottom: 10px;
      overflow:hidden;
    }

    .OA_button {
      display:table;
      margin: 3px;


    }



    .OA_twowayselect_container{
      display:flex;
    }
    .OA_twowayselect_container > div{
      flex:1;
    }


    .OA_twowayselect_left{
      width: 150px !important;
      min-width: 150px;

    }


    .OA_twowayselect_right{
      width: 150px !important;
      min-width: 150px;

    }

    .OA_twowayselect_middle{
      width: 30px !important;
      max-width: 30px;
      margin:auto;
    }



    .debrmanager_dialog_q{
      margin-top:30px;
    }

    .debrmanager_dialog_q_text{
      font-weight: bold;
      font-size: 14px;
    }

    .debrmanager_dialog_q_choice{
      margin-top:7px;
    }

    .debrmanager_dialog_container{
      background-color: #f8efc0;
    }


    .sslmanager_dialog_container{
      background-color: #f8efc0;
    }

    .sslmanager_dialog_q{
      margin-top:30px;
    }

    .sslmanager_dialog_q_text{
      font-weight: bold;
      font-size: 14px;
    }

    .sslmanager_dialog_q_choice{
      margin-top:7px;
    }

    .corrbrush_panel .extent {
      fill: #d95f0e;

      opacity: 0.8;

    .corrbrush_panel .ellrect{
      fill:#fff7bc !important;

      opacity: 0.8;
    }

    .gmmlinebrush_panel .gmmlinerect{
      fill:#fff7bc !important;

      opacity: 0.8;
    }

    .gmmlinebrush_panel .extent {
      fill: #d95f0e;

      opacity: 0.8;
    }
